import { Link } from "react-router-dom";
import pdfResume from "../work_assets/Hernandez_Mateo_Resume25W.pdf";
import blackButton from "../assets/blackbutton.png";
import whiteButton from "../assets/whitebutton.png";

const GetIT = () => {
  return (
    <div className="w-full flex border-y-4 bg-stone-950 p-5 gap-4">
      <div className="flex-grow grid grid-cols-2 gap-4">
        <a href={pdfResume} target="_blank" rel="noreferrer">
          <div class="group relative h-64 w-64">
            (Default visible)
            <img
              src={blackButton}
              alt="Default"
              class="absolute inset-0 h-full w-full object-cover opacity-100 transition-opacity duration-300 group-hover:opacity-0"
            />
            (Visible on hover)
            <img
              src={whiteButton}
              alt="Hover State"
              class="absolute inset-0 h-full w-full object-cover opacity-0 transition-opacity duration-300 group-hover:opacity-100"
            />
          </div>
        </a>
        <Link to="/dropdown">
          <button className="font-source_san_3 font-bold text-2xl bg-stone-50 h-full w-full hover:bg-stone-950 text-stone-950 hover:text-stone-50 py-2 px-2 border-4 border-stone-50 hover:border-stone-50">
            Contact
          </button>
        </Link>
      </div>
      <h1 className="text-8xl text-stone-50 font-bold flex justify-end">
        GET IN TOUCH
      </h1>
    </div>
  );
};

export default GetIT;
